import React from 'react'

export default function ActivitiesDetail({actsDetail, country}) {



  return (
    <div>
        <h3>Activities for {country}</h3>
        <table>
               
            {/* // <ul key={el.id}>
            // <h3>Activity: {el.name}</h3>
            // <h3>Duration: {el.duration} (hours)</h3>
            // <h3>Difficulty: {el.difficulty}</h3>
            // <h3>Season: {el.season}</h3>
            // </ul> */}
            <tr>
              <th>Name</th>
              <th>Difficulty</th>
              <th>Duration</th>
              <th>Season</th>
            </tr>
          {
            actsDetail?.map(el =>  (
            <tr>
              <td>{el.name}</td>
              <td>{el.difficulty}</td>
              <td>{el.duration}</td>
              <td>{el.season}</td>
            </tr>
            ))
          }
        </table>
        
    </div>
  )
};
